import 'bootstrap/dist/css/bootstrap.min.css';

import React, { useState } from 'react';

import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import axios from 'axios';

export default class Register extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      login: "",
      email: "",
      password: "",
      blogTitle: "",
    }
    this.handleLogin = this.handleLogin.bind(this);
    this.handlePassword = this.handlePassword.bind(this);
    this.handleBlogTitle = this.handleBlogTitle.bind(this);
    this.handleEmail = this.handleEmail.bind(this);

    this.handleSubmit = this.handleSubmit.bind(this);

  }

  handleLogin(event) {   
     this.setState({login: event.target.value});  
    }

    handlePassword(event) {   
      this.setState({email: event.target.value});  
     }

     handleBlogTitle(event) {   
      this.setState({password: event.target.value});  
     }

     handleEmail(event) {   
      this.setState({blogTitle: event.target.value});  
     }

  /*
    const [login, setLogin] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [blogTitle, setBlogTitle] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    const response = await axios.post("auth/register", {
      login,
      email,
      password,
      blogTitle,
    });
    console.log(response);
  }
  */

  async handleSubmit(event) {
    event.preventDefault();
    const response = await axios.post("auth/register", {
      login,
      email,
      password,
      blogTitle,
    });
    console.log(response);
  }
  render() {
    return (
        <form onSubmit={this.handleSubmit}>
        <Form.Group className="mb-3" controlId="formBasicEmail">
            <Form.Label>Email address</Form.Label>
            <Form.Control type="email" placeholder="Enter email"
            value={this.state.email}
            onChange={this.handleEmail}
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="formLogin">
            <Form.Label>Login</Form.Label>
            <Form.Control type="login" placeholder="Enter Login" 
            value={this.state.login}
            onChange={this.handleLogin}
              />

            </Form.Group>
            <Form.Group className="mb-3" controlId="formBlogTitle">
            <Form.Label>Blog Title</Form.Label>
            <Form.Control type="blogTitle" placeholder="Enter Blog Title" 
            value={this.state.blogTitle}
            onChange={this.handleBlogTitle}
            />
            </Form.Group>

            <Form.Group className="mb-3" controlId="formPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Enter Password" 
            value={this.state.password}
            onChange={this.handlePassword}
            />
        </Form.Group>
        <Button variant="primary" type="submit">
            Submit
        </Button>
    </form>
    );
  }
}
